--    Main    --
----------------

function OnChatMessage()
    local message = TriggerData.message
    if not message or StopFlag then return end

    local huntingPattern = "Hunting elite mark ([%w%s%-'–]+) in ([%w%s%-'–]+)"
    for markName, location in message:gmatch(huntingPattern) do
        if not WeeklyHunts then
            WeeklyHunts = {}
        end

        local exists = false
        for _, hunt in ipairs(WeeklyHunts) do
            if hunt.name == markName and hunt.location == location then
                exists = true
                break
            end
        end

        if not exists then
            table.insert(WeeklyHunts, { name = markName, location = location })
            LogInfo(string.format("%s Found hunt: %s in %s", LogPrefix, markName, location))

            if State == CharacterState.waitForNextHuntWeekly then
                local nextHunt = table.remove(WeeklyHunts, 1)
                if nextHunt then
                    CurrentHunt = nextHunt
                    State = CharacterState.goToMarkerWeekly
                    LogInfo(string.format("%s State changed to: GoToMarkerWeekly", LogPrefix))
                end
            end
        end
    end
end

function CharacterState.goToHuntBoardWeekly()
    if BoardNumber > #HuntBoards then
        State = CharacterState.selectNextHuntWeekly
        LogInfo(string.format("%s State changed to: SelectNextHuntWeekly", LogPrefix))
        Wait(0.5)
        return
    end

    Board = HuntBoards[BoardNumber]
    LogInfo(string.format("%s Checking board: %s", LogPrefix, Board.city))

    local skipBoard = true
    if GetItemCount(Board.bills) == 0 then
        skipBoard = false
    end

    LogInfo(string.format("%s skipBoard = %s", LogPrefix, tostring(skipBoard)))

    if skipBoard then
        BoardNumber = BoardNumber + 1
        return
    end

    if not IsInZone(Board.zoneId) then
        LogInfo(string.format("%s Not in %s, teleporting to %s", LogPrefix, Board.city, Board.aetheryte))
        Teleport(Board.aetheryte)
    end

    if Board.miniAethernet ~= nil then
        local distanceToBoard       = GetDistanceToPoint(Board.x, Board.y, Board.z)
        local distanceFromAethernet = DistanceBetween(Board.miniAethernet.x, Board.miniAethernet.y, Board.miniAethernet.z, Board.x, Board.y, Board.z)

        LogInfo(string.format("%s Distance to board: %.2f", LogPrefix, distanceToBoard))
        LogInfo(string.format("%s Distance from mini aetheryte: %.2f", LogPrefix, distanceFromAethernet))

        if distanceToBoard > (distanceFromAethernet + 20) then
            Target("Aetheryte")
            MoveToTarget("Aetheryte", 7)
            Wait(1)
            Teleport(Board.miniAethernet.name)
        end
    end

    if GetDistanceToPoint(Board.x, Board.y, Board.z) > 3 then
        if not PathIsRunning() and not PathfindInProgress() then
            MoveTo(Board.x, Board.y, Board.z, 3)
        end
    end

    if GetDistanceToPoint(Board.x, Board.y, Board.z) < 4 then
        State = CharacterState.pickUpHuntsWeekly
        LogInfo(string.format("%s State changed to: PickUpHuntsWeekly", LogPrefix))
    end
end

function CharacterState.pickUpHuntsWeekly()
    if HuntNumber >= 1 then
        if IsAddonReady("Mobhunt") or IsAddonReady("Mobhunt" .. BoardNumber) then
            local addonName = (BoardNumber == 1) and "Mobhunt" or ("Mobhunt" .. BoardNumber)
            Execute(string.format("/callback %s true -1", addonName))
        else
            HuntNumber = 0
            BoardNumber = BoardNumber + 1
            State = CharacterState.goToHuntBoardWeekly
            LogInfo(string.format("%s State changed to: GoToHuntBoardWeekly %d", LogPrefix, BoardNumber))
        end
        return
    end

    if IsAddonReady("SelectYesno") and GetNodeText("SelectYesno", 15) == "Pursuing a new mark will result in the abandonment of your current one. Proceed?" then
        Execute("/callback SelectYesno true 1")
        HuntNumber = HuntNumber + 1
        return
    end

    if IsAddonReady("SelectString") then
        local optionIndex = (BoardNumber == 1) and 1 or 3
        Execute(string.format("/callback SelectString true %s", optionIndex))
        return
    end

    if IsAddonReady("Mobhunt") or IsAddonReady("Mobhunt" .. BoardNumber) then
        local addonName = (BoardNumber == 1) and "Mobhunt" or ("Mobhunt" .. BoardNumber)
        Execute(string.format("/callback %s true 0", addonName))
        HuntNumber = HuntNumber + 1
        return
    end

    if Board and Board.boardName then
        Interact(Board.boardName)
    end
end

function CharacterState.selectNextHuntWeekly()
    if StopFlag then
        return nil
    end

    LogInfo(string.format("%s Requesting Next Hunt", LogPrefix))
    Execute("/phb next")

    State = CharacterState.waitForNextHuntWeekly
    LogInfo(string.format("%s State changed to: WaitForNextHuntWeekly", LogPrefix))
end


function CharacterState.waitForNextHuntWeekly()
    Wait(1)
end

function CharacterState.goToMarkerWeekly()
    if not CurrentHunt then
        LogInfo(string.format("%s No Hunt data provided, cannot go to marker.", LogPrefix))
        return
    end

    local huntLocation, huntPath
    for _, monsters in pairs(BRank) do
        Echo(string.format("Mob name: %s", monsters.name), LogPrefix)
        LogInfo(string.format("%s Mob name: %s", LogPrefix, monsters.name))
        if monsters.name == CurrentHunt.name then
            huntLocation = monsters.location
            huntPath = monsters.path
            Echo(string.format("Hunt located. Target: %s near aetheryte: %s", monsters.name), LogPrefix)
            LogInfo(string.format("%s Hunt located. Target: %s near aetheryte: %s", LogPrefix, monsters.name, huntLocation))
            break
        end
    end

    if not huntLocation or not huntPath then
        LogInfo(string.format("%s Hunt target not found in BRank table: %s", LogPrefix, CurrentHunt.name))
        return
    end

    if not IsInZone(huntLocation) then
        if huntLocation == "Idyllshire" then
            GoToDravanianHinterlands()
        else
            Teleport(huntLocation)
        end

        return
    end

    Mount()
    VislandRouteStart(huntPath, true)
    Wait(5)

    while IsVislandRouteRunning() do
        if CurrentHunt ~= nil and CurrentHunt.name ~= nil and FindNearestObjectByName(CurrentHunt.name) then
            VislandRouteStop()
            break
        end
        Wait(1)
    end

    Dismount()
    Wait(1)
    State = CharacterState.doHuntWeekly
    LogInfo(string.format("%s State changed to: DoHuntWeekly", LogPrefix))
end

function CharacterState.doHuntWeekly()
    local hunt = CurrentHunt
    if not hunt or not hunt.name then
        LogInfo(string.format("%s No current hunt available, skipping.", LogPrefix))
        State = CharacterState.endScriptWeekly
        return
    end

    Target(hunt.name)
    Execute("/bmrai on")
    Execute("/rsr auto")

    while GetDistanceToTarget() > 5 do
        MoveToTarget(hunt.name, 3)
        Wait(1)
    end

    WaitForCondition("InCombat", true)
    Wait(1)
    WaitForCondition("InCombat", false)
    Wait(1)

    Execute("/bmrai off")
    Execute("/rsr off")

    if not StopFlag then
        local nextHunt = CharacterState.selectNextHuntWeekly()
        if nextHunt then
            CurrentHunt = nextHunt
            State = CharacterState.goToMarkerWeekly
            LogInfo(string.format("%s State changed to: GoToMarkerWeekly", LogPrefix))
        else
            State = CharacterState.endScriptWeekly
            LogInfo(string.format("%s State changed to: EndScriptWeekly", LogPrefix))
        end
    end
end

function CharacterState.endScriptWeekly()
    StopFlag = true
    LogInfo(string.format("%s Weekly hunt script ended.", LogPrefix))
end

--=========================== EXECUTION ==========================--

State = CharacterState.goToHuntBoardWeekly

while not StopFlag do
    State()
    Wait(0.1)
end

Echo("Weekly Hunts script completed successfully. All Marks Obtained..!!", LogPrefix)
LogInfo(string.format("%s Weekly Hunts script completed successfully. All Marks Obtained..!!", LogPrefix))

